import React, { Component } from "react";

// import "./icon.css";

const icons = {
  "C#":
    "M0 32l34.9 395.8L191.5 480l157.6-52.2L384 32H0zm308.2 127.9H124.4l4.1 49.4h175.6l-13.6 148.4-97.9 27v.3h-1.1l-98.7-27.3-6-75.8h47.7L138 320l53.5 14.5 53.7-14.5 6-62.2H84.3L71.5 112.2h241.1l-4.4 47.7z"
};

export default class icon extends Component {
  render() {
    const { icon } = this.props;
    return icons[icon] ? (
      <svg
        aria-hidden="true"
        data-prefix="fab"
        data-icon="html5"
        class="svg-inline--fa fa-html5 fa-w-12"
        role="img"
        height="22"
        width="22"
        xmlns="http://www.w3.org/2000/svg"
      >
        <path width="100%" height="100%" fill="currentColor" d={icons[icon]} />
      </svg>
    ) : (
      <span>{icon}</span>
    );
  }
}
